height: 100%;
color: #FF6E1E;
background-color: white;
font-family: Open Sans, Helvetica, Sans-Serif;
font-size: calc(1em+1vm);
}
header {
position: relative;
display: block;
color: white;
background-color: white;
z-index: 2;
height: 80px;
vertical-align: middle;
}
header img {
position: relative;
display: inline;
padding-left: 20px;
margin: 0;
padding-top: 32px;
}
header h1 {
position: relative;
display: inline-block;
margin: 0.3em;
border: 0;
padding: 0;
font-size: 3em;
font-weight: normal;
color: #FF6E1E;
}
header a, header a:link, header a:visited, header a:active, header a:hover, header a:focus {
color: #FF6E1E;
background-color: inherit;
}
a, a:link, a:visited {
color: #FF6E1E;
background-color: inherit;
text-decoration: none;
}
a:active, a:hover, a:focus {
color: #76777B;
font-weight: bolder;
}
nav {
position: relative;
display: block;
width: 100%;
margin: 0;
padding: 0;
font-size: 1.0em;
vertical-align: middle;
color: black;
background-color: #AAA99F; 
text-align: right;
}
nav div {
display: inline-block;

margin-left: 10em;
margin-right: 10em;
}
nav a, nav a:link, nav a:visited, nav a:active {
color: white;
background-color: inherit;
text-decoration: none;
}
nav a:hover, nav a:focus {
color: #FF6E1E;
background-color: inherit;
text-decoration: none;
}
nav div h2 {
position: relative;
display: block;
min-width: 20%;
margin: 0;
font-size: 1.24em;
font-style: normal;
}
nav div > ul {
display: none;
padding-left: 0.24em;
text-align: left;
}
nav ul {
display: inline-block;
padding-left: 0.24em;
list-style-type: none;
text-align: left;
text-decoration: none;
}
nav ul li {
display: inline;
padding: 1em;
}
body img {
padding: 0;
display: block;
margin: auto;
max-height: 100%;
max-width: 100%;
}
form {
padding: 0;
display: inline-block;
margin: auto;
max-height: 100%;
max-width: 100%;
}
section {
position: relative;
display: inline-block;
width: 98%;
min-height: 84%;
color: black;
background-color: white;
margin-left: 1vw;
margin-right: 1vw;
margin-bottom: 2em;
padding: 0;
}
section p {
text-align: center;
font-family: Open Sans, Helvetica, Sans-Serif;
}
li {
margin-right: 1vw;
}
section h1 {
text-align: center;
font-family: Open Sans, Helvetica, Sans-Serif;
font-size: 2.0em;
font-weight: 600;
}
section h2 {
font-size: 1.5em;
font-weight: 600;
}
section h3 {
font-size: 1.25em;
font-weight: 600;
}
section ul {
display: block;
list-style: inside;
list-style-type: '- ';
margin: 0;
padding-left: 1.24em;
}
aside {
margin: 0;
border: 0;
padding-left: 1em;
position: relative;
display: inline-block;
text-align: right;
}
aside h2 {
font-size: 1em;
text-transform: uppercase;
}
aside h2 > a {
font-style: normal;
}
aside ul {
margin: 0;
padding: 0;
display: block;
list-style-type: none;
}
aside ul li {
font-size: 0.82em;
}
aside ul > ul {
padding-left: 1em;
font-size: 0.72em;
}
table {
border-collapse: collapse;
}
table, th, td {
border: 1px solid black;
padding: 1em;
}
input {
border: 1px solid black;
padding: 1em;
}
tr:nth-child(odd) {background-color: #f2f2f2}
footer .logoblock {
position: absolute;
width: 10%;
right: 0;
margin-right: 5px;
text-align: left;
}
footer .logoimg {
margin: 2px;
}
footer .logotxt {
margin: 2px;
}
footer {
position: relative;
bottom: 0;
display: block;
width: 100%;
height: 5em;
color: white;
background-color: #616265;
text-align: center;
font-size: 80%;
z-index: 2;
}
footer span {
position: relative;
display: block;
margin-left: auto;
margin-right: auto;
width: 100px;
padding-left: 0.24em;
text-align: center;
font-family: Open Sans, Helvetica, Sans-Serif;
font-size: 1em;
}
footer a, footer a:link, footer a:visited, footer a:active, footer a:focus, footer a:hover {
padding: 0;
display: inline;
color: #FF6E1E;
text-decoration: none;
}

.column {
float: left;
width: 16.6%;
}

.row::after {
content: "";
clear: both;
display: table;
}
</style>
